pragma solidity ^0.4.18;

contract ClaimYourMoney{

  string enMsg;

  struct Sender {
     address addr;
     uint256 amount;
     string enMsg;
  }

  mapping (address => Sender ) public data;

  event Transfer(address indexed _from, address indexed _to, uint256 _value,
     string _enMsg);

  event Claim(address indexed _from, address indexed _to, uint256 _value,
        string _enMsg);


  function sendMoney(address receiver, uint amount) public returns(uint){
    data[msg.sender].amount -= amount;
    if(claimMyMoney(receiver, amount)){
      data[receiver].amount += amount;
      emit Transfer(msg.sender, receiver, amount, data[msg.sender].enMsg);
    }
    return amount;
  }

  function claimMyMoney(address receiver, uint amount ) public returns(bool){
    string storage msgSender = data[msg.sender].enMsg;
    string storage msgReceiver = data[receiver].enMsg;
    if(sha3(msgSender) == sha3(msgReceiver)){
        emit Claim(receiver, msg.sender, amount, msgSender);
        return true;
      } else{
          data[msg.sender].amount += amount;
          return false;
      }

  }




}
